import"./@react-router-BOJM2k20.js";try{let e=typeof window<"u"?window:typeof global<"u"?global:typeof globalThis<"u"?globalThis:typeof self<"u"?self:{},t=new e.Error().stack;t&&(e._sentryDebugIds=e._sentryDebugIds||{},e._sentryDebugIds[t]="5358cdac-4f21-49e1-8736-06dc6137234a",e._sentryDebugIdIdentifier="sentry-dbid-5358cdac-4f21-49e1-8736-06dc6137234a")}catch{}const n={status_code:200,data:{items:[{id:"1",subject:"Welcome to Our Mining Operations Team",to:["Ahmad Wijaya","Siti Rahayu"],cc:["Diana Kusuma"],via:"Email",body:"<h2>Welcome to Our Company!</h2><p>Dear Team,</p><p>We are excited to welcome you to our mining operations. This message contains important information to get you started.</p><ul><li>Check your employee handbook</li><li>Complete your onboarding tasks</li><li>Meet your team members</li></ul><p>Best regards,<br/>HR Team</p>",template_used:"Welcome Email Template",status:"Sent",created_at:"2023-08-15T00:00:00.000Z",updated_at:"2023-08-15T00:00:00.000Z"},{id:"2",subject:"Mining Project Status Update - Q3 2023",to:["Budi Santoso","Eko Prasetyo"],cc:["Ahmad Wijaya","Diana Kusuma"],via:"Apps",body:"<h2>Project Status Update</h2><p>Hello Team,</p><p>This is an automated update regarding project <strong>Copper Mining Expansion Phase 2</strong>:</p><p><strong>Current Status:</strong> In Progress<br/><strong>Completion:</strong> 75%<br/><strong>Next Milestone:</strong> Equipment Installation</p><p>Please review the attached documents and provide feedback by August 30th.</p><p>Thank you,<br/>Project Management Office</p>",template_used:"Project Update Notification",status:"Sent",created_at:"2023-08-20T00:00:00.000Z",updated_at:"2023-08-20T00:00:00.000Z"},{id:"3",subject:"Monthly Safety Meeting Reminder",to:["Siti Rahayu","Eko Prasetyo","Diana Kusuma"],cc:["Ahmad Wijaya"],via:"Keduanya",body:"<h2>Meeting Reminder</h2><p>Dear Team,</p><p>This is a friendly reminder about our upcoming meeting:</p><p><strong>Meeting:</strong> Monthly Safety Review<br/><strong>Date:</strong> September 5, 2023<br/><strong>Time:</strong> 09:00 AM<br/><strong>Location:</strong> Conference Room A</p><p><strong>Agenda:</strong></p><ol><li>Safety incident review</li><li>New safety protocols</li><li>Equipment maintenance status</li></ol><p>Please confirm your attendance.</p><p>Best regards,<br/>Safety Department</p>",template_used:"Meeting Reminder",status:"Draft",created_at:"2023-09-01T00:00:00.000Z",updated_at:"2023-09-01T00:00:00.000Z"},{id:"4",subject:"System Maintenance - Mining Operations Platform",to:["Ahmad Wijaya","Budi Santoso","Siti Rahayu","Diana Kusuma","Eko Prasetyo"],cc:[],via:"Email",body:"<h2>Scheduled System Maintenance</h2><p>Dear Users,</p><p>We would like to inform you about upcoming system maintenance:</p><p><strong>Maintenance Window:</strong> 02:00 AM - 06:00 AM<br/><strong>Date:</strong> September 10, 2023<br/><strong>Expected Duration:</strong> 4 hours</p><p><strong>Affected Systems:</strong></p><ul><li>Mining Operations Dashboard</li><li>Equipment Monitoring System</li><li>Safety Reporting Platform</li></ul><p>During this time, services may be temporarily unavailable. We apologize for any inconvenience.</p><p>IT Support Team</p>",template_used:"System Maintenance Notice",status:"Sent",created_at:"2023-09-05T00:00:00.000Z",updated_at:"2023-09-05T00:00:00.000Z"},{id:"5",subject:"Invoice Payment Reminder - Equipment Rental",to:["Budi Santoso"],cc:["Ahmad Wijaya"],via:"Apps",body:"<h2>Payment Reminder</h2><p>Dear Budi Santoso,</p><p>This is a friendly reminder that payment for invoice <strong>INV-2023-08-001</strong> is due.</p><p><strong>Invoice Details:</strong></p><p><strong>Amount:</strong> Rp 2,500,000,000<br/><strong>Due Date:</strong> September 15, 2023<br/><strong>Invoice Date:</strong> August 15, 2023</p><p>Please ensure payment is made by the due date to avoid any late fees. If you have already made the payment, please disregard this message.</p><p>For questions, contact our billing department at finance@freeport.com.</p><p>Thank you,<br/>Billing Department</p>",template_used:"Invoice Payment Reminder",status:"Sent",created_at:"2023-09-10T00:00:00.000Z",updated_at:"2023-09-10T00:00:00.000Z"},{id:"6",subject:"Security Alert - Unauthorized Access Attempt",to:["Ahmad Wijaya"],cc:["Diana Kusuma"],via:"Keduanya",body:"<h2>Security Alert</h2><p>Dear Ahmad Wijaya,</p><p><strong>IMPORTANT SECURITY NOTICE</strong></p><p>We detected unusual activity on your account:</p><p><strong>Event:</strong> Multiple failed login attempts<br/><strong>Time:</strong> September 12, 2023 14:35 WIB<br/><strong>Location:</strong> Jakarta, Indonesia<br/><strong>IP Address:</strong> 192.168.1.100</p><p>If this was you, no action is required. If you don't recognize this activity:</p><ol><li>Change your password immediately</li><li>Review recent account activity</li><li>Contact our security team at security@antam.com</li></ol><p>Stay safe,<br/>Security Team</p>",template_used:"Security Alert",status:"Sent",created_at:"2023-09-12T00:00:00.000Z",updated_at:"2023-09-12T00:00:00.000Z"}],meta:{total_page:1,total:6,page:1,per_page:10}},version:"1.0.0"},i=e=>({status_code:200,data:n.data.items.find(a=>a.id===e)||null,version:"1.0.0"});export{n as a,i as m};
